import React from 'react';

const VideoDetail = props => {
    if(!props.video) {
        return <div>Loading...</div>
    }
    return (
        <div>
             <div style={{fontSize: '18px'}}>{props.video.snippet.title}</div>
            <div>{props.video.snippet.description}</div>
        </div>
       
    )
}

export default VideoDetail;
